import React from 'react';
import '../../App.css';
import './Profile.css';
import axios from 'axios';

class Profile extends React.Component{
 
    render(){
        return(
            <div className='statistiques'>Statistiques
                <h1>
                    Result Page
                </h1>
                <h2>
                    Name: <span id="result-servers" />
                </h2>
                <h2>
                    Surname: <span id="result-summoner" />
                </h2>


            </div>
        )
     }
}

export default Profile;
